function mstotime(durata){
    var ore = durata / (1000 * 60 * 60);
    durata -= (ore * 1000 * 60 * 60);
    var minuti = (int)(durata / (1000 * 60));
    durata -= (minuti * 1000 * 60 );
    if(minuti<10){
        return (ore+""+minuti)*10;
    }else{
        return (ore+""+minuti)*1;
    }
}

